import React from "react";

import Image from "next/image";

import { PictureContainer } from "./styles";

function ProfilePicture() {
  return (
    <PictureContainer>
      <Image
        src="/images/lq_1.jpg"
        alt="Long-Quan"
        width={150}
        height={150}
        layout="responsive"
        quality="75"
      />
    </PictureContainer>
  );
}

export default ProfilePicture;
